  [516]="1.在剧本中开启自动战斗时，角色会根据此处配置的条目行动\n2.角色行动时，会根据列表从上到下的顺序依次判断条目中的目标是否存在。当目标存在时，将直接执行对应的行为；否则继续往下判定\n3.若列表中所有的条目都找不到指定目标，角色将跳过本回合的行动\n4.自动战斗方式选择“自定义”时可以增加.删除.移动.修改各条目的具体内容。自动战斗方式选择特定模板时，将根据当前角色的上阵武学自动生成全部条目",
