  [550]="制造熟练度:　可提高制造装备时, 白字属性的完美概率。",
  [551]="1.强化装备，可以提升装备的白字和绿字属性；\n2.强化装备+1~+4时，消耗铜币，+5以上消耗银锭；\n3.强化+5起，每强化一次，装备所需等级条件提高1级。",
  [552]="1.每次重铸时，有一定几率随机到完美属性；\n2.提升重铸熟练度等级，可提高重铸出完美的几率，重铸熟练度提升1级，完美几率+1%；\n3.随到完美属性的几率如下：\n   白色装备：5%(重铸熟练度1级)，15%(重铸熟练度11级)\n   绿色装备：4%(重铸熟练度1级)，15%(重铸熟练度12级)\n   蓝色装备：3%(重铸熟练度1级)，15%(重铸熟练度13级)\n   紫色装备：2%(重铸熟练度1级)，15%(重铸熟练度14级)\n   橙色装备：1%(重铸熟练度1级)，15%(重铸熟练度15级)\n   金色装备：0%(重铸熟练度1级)，14%(重铸熟练度15级)\n   暗金装备：0%(重铸熟练度2级)，13%(重铸熟练度15级)\n4.所有装备重铸时，如果连续100次未随到完美属性，则下一次必定随出完美属性；\n5.每件装备单独计算重铸未完美次数，一件装备连续100次未随到完美属性，只会让这件装备下次必定随出完美属性，换其他装备需要重新计数；\n6.随出任意完美属性后，连续未完美次数重置为0。",
  [553]="1.只有带有完美绿字属性的装备才可熔炼；\n2.熔炼后装备消失，获得完美粉。获得数量和装备的品质.完美条目数量有关。",
  [554]="1.每次开始新游戏时，若选择消耗幸运值，将大大增加本次游戏中的资源产出，包括：\n  -野外迷宫、藏宝迷宫等途径的宝箱掉落的道具\n  -月度演化时，出现在侠客背包的道具\n  -神秘商人张少爷售卖的道具\n2.幸运值在每周一0:00回复至100点。\n3.解锁完整版游戏后，每周剩余的幸运值，将转化为幸运成长礼包。",
  [555]="1.每击败一个右侧的恶霸，将获得一个恶霸头巾，用来兑换下方奖励。\n2.每击败一个右侧的恶霸，将自动参与全服夺宝，参与推进全服夺宝进度。\n3.全服夺宝进度到达100%时，最近一次参与寻宝的玩家，将获得当前夺宝奖励。\n4.每次夺宝中，贡献排名第一的玩家，同样能获得一份当前夺宝奖励。点击进度条，可以查看贡献排名。",
  [556]="1.一键装备，会按照角色当前最高攻击的系别，优先选择装备类型。如拳掌攻击最高，就会装备拳套。在所有拳套武器内，选择品质最高的装备。\n2.队友被替换下来的装备，如果是他自己的传家宝，会进入他自己的包裹，仅可通过乞讨、切磋、决斗获得。其他装备，将会进入玩家的包裹。\n3.直接脱队友的装备，会根据装备品质和好感度，决定是否允许脱装备，以及强行脱装备扣减的好感度。",
  [557]="当前配置的AI条目数量已经达到上限",
  [558]="对不起，当前服务器火爆，起名可能无法立刻生效，请过一段时间后再返回此界面查看并尝试重新起名。",
  [559]="1.队伍中每一名出战角色，每进行一场擂台战斗，可获得100点对应门派的声望。如队伍中有3名丐帮队友，进行了2场擂台战斗，可获得600点丐帮声望。\n2.大众赛、大师赛可获得门派声望，少年赛、门派赛、华山论剑不获得门派声望。\n3.每个门派声望前32名的玩家，将自动入围该门派的门派赛。每周日进行3个门派的门派赛，各门派轮流。所有门派的门派赛举行后，下个周日举行华山论剑。\n4.所有门派声望在华山论剑后清空，按照每点声望折算1点经脉经验，通过邮件发送。",
  [560]="1.周目结算时，金色、暗金物品，任意品质传家宝，+5及以上装备，都会带出到仓库，其他物品会转化为经脉经验；\n2.仓库已满时，物品可以带出，但需要清理仓库才可以开启新的剧本；\n3.所有任务物品（含汗血宝马）不可带出，也不会转化为经脉经验。",
